using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Habitual.Core.Entities;
using Newtonsoft.Json;

namespace Habitual.Storage.Local
{
    public static class TemporaryStorageGenerator
    {
        public static void InitializeTaskContainerIfRequired()
        {
            
            if (string.IsNullOrEmpty(LocalData.TaskContainer))
            {
                var taskContainer = TaskContainer.GetTaskContainer();
                LocalData.TaskContainer = JsonConvert.SerializeObject(taskContainer); 
            }
        }

        public static void CreateUser(string username, string password)
        {
            var user = new User(username, password);
            user.Avatar = Convert.FromBase64String("");
            user.Points = 0;

            LocalData.User = JsonConvert.SerializeObject(user);
        }

        private static void CreateTempTodos()
        {
            var todoList = new List<Todo>();
            var todo = new Todo();
            todo.Username = "admin";
            todo.Description = "Todo something";
            todo.Difficulty = Difficulty.Easy;
            todo.ID = Guid.NewGuid();
            todoList.Add(todo);

            var todo2 = new Todo();
            todo2.Username = "admin";
            todo2.Description = "Todo another thing";
            todo2.Difficulty = Difficulty.Medium;
            todo2.IsDone = true;
            todo2.ID = Guid.NewGuid();

            todoList.Add(todo2);

            var taskContainer = JsonConvert.DeserializeObject<TaskContainer>(LocalData.TaskContainer);
            taskContainer.Todos = todoList;
            LocalData.TaskContainer = JsonConvert.SerializeObject(taskContainer);
        }

        private static void CreateTempHabits()
        {
            var habitList = new List<Habit>();
            var habit = new Habit();
            habit.Username = "admin";
            habit.Description = "Do stuff";
            habit.Difficulty = Difficulty.Easy;
            habit.ID = Guid.NewGuid();
            habitList.Add(habit);

            var habit2 = new Habit();
            habit2.Username = "admin";
            habit2.Description = "Do more stuff";
            habit2.Difficulty = Difficulty.Medium;
            habit2.ID = Guid.NewGuid();

            habitList.Add(habit2);

            var taskContainer = JsonConvert.DeserializeObject<TaskContainer>(LocalData.TaskContainer);
            taskContainer.Habits = habitList;
            taskContainer.HabitLogs = new List<HabitLog>();
            LocalData.TaskContainer = JsonConvert.SerializeObject(taskContainer);
        }

        private static void CreateTempRoutines()
        {
            var routineList = new List<Routine>();
            var routine = new Routine();
            routine.Username = "admin";
            routine.Description = "Do stuff Wednesday";
            routine.Difficulty = Difficulty.Easy;
            routine.ID = Guid.NewGuid();
            routine.IsActiveWednesday = true;
            routineList.Add(routine);

            var routine2 = new Routine();
            routine2.Username = "admin";
            routine2.Description = "Do stuff Thursday";
            routine2.Difficulty = Difficulty.Medium;
            routine.IsActiveThursday = true;
            routine2.ID = Guid.NewGuid();

            routineList.Add(routine2);

            var taskContainer = JsonConvert.DeserializeObject<TaskContainer>(LocalData.TaskContainer);
            taskContainer.Routines = routineList;
            taskContainer.RoutineLogs = new List<RoutineLog>();
            LocalData.TaskContainer = JsonConvert.SerializeObject(taskContainer);
        }
    }
}
